import { Divider, Drawer, List, ListItemButton, ListItemText, styled } from "@mui/material";
import { DrawerCloseButton } from "../../styles/appbar";
import { useContext, useUIContext } from "../../context/ui";
import CloseIcon from '@mui/icons-material/Close';

const MiddleDivider = styled((props)=>(
    <Divider variant='midle'{...props}/>
))``;

export default function AppDrawer(){

    const { drawerOpen, setDrawerOpen} = useUIContext();

    return(
        <Drawer open={true}>
            {drawerOpen && <DrawerCloseButton onlclick={() => setDrawerOpen (false)}>Close</DrawerCloseButton>}
            <List>
                <ListItemButton>
                    <ListItemText>Home</ListItemText>
                </ListItemButton>
                <MiddleDivider/>
                <ListItemButton>
                    <ListItemText>Categories</ListItemText>
                </ListItemButton>
                <MiddleDivider/>
                <ListItemButton>
                    <ListItemText>Products</ListItemText>
                </ListItemButton>
                <MiddleDivider/>
                <ListItemButton>
                    <ListItemText>About Us</ListItemText>
                </ListItemButton>
                <MiddleDivider/>
                <ListItemButton>
                    <ListItemText>Contact Us</ListItemText>
                </ListItemButton>
                <MiddleDivider/>
            </List>
        </Drawer>
    )
};
